import React from 'react';
import './Home.css';
import heroImage from '../images/organ.jpg'; // Update with your actual image path

function Home() {
  return (
    <div className="home-container">
      <h2>Welcome to Organ Tracker</h2>
      <p>Track and manage organ donations with ease.</p>
      <button className="home-btn">Get Started</button>
      <img src={heroImage} alt="Organ Tracker" className="hero-img" />
    </div>
  );
}

export default Home;
